import "./SkillBar.scss";

export default function SkillBar({name, level, color}) {
  return (
    <div className="skillbar">
        <li className="skill" style={{width: `${level}%`, backgroundColor: color}}>
          <span className="label">{name}</span>
        </li>
    </div>
  );
}
